    "2013-03-15T23:17:45.622662",nt"name": "geology-of-the-concordwaterford-area-vermont",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
    Tectonic map, and text on the bedrock geology of the ConcordWaterford Area, Vermont.
    Abstract: The Concord-Waterford area is located in northeastern Vermont, between
    St. Johnsbury and the Connecticut River. Its geologic setting is  the belt of predominantly
    low-grade metamorphic rocks of Paleozoic age  between the Willoughby arch to the
    west and the White Mountains to the east.",nt"license_title": null,nt"extras":
